  cargarDatos(idPeea: any) {
    this.peeaService.obtenerPeea17ilvemById(idPeea).subscribe((resp: any) => {
      this.peea17 = resp.data;
      this.contratoSevice.obtenerContratoById(this.peea17?.idContrato).subscribe((resp: any) => {
        this.contrato = resp.data;
        this.representanteService.obtenerRepresentanteById(resp.data.idRepresentante).subscribe((resp: any) => {
          this.representante = resp.data;
          this.estudianteService.getAllEstudiantesByIdRepresentante(resp.data._id).subscribe((resp: any) => {
            this.estudiante = resp.data[0];
            this.createPDF(this.estudiante, this.representante, this.contrato, this.peea17);
          });
        });
      });
    })
  }



